import React from "react";
import FilterSection from "./../components/FilterSection";

function FilterPage(props) {
  return (
    <FilterSection
      bg="white"
      textColor="dark"
      size="md"
      bgImage=""
      bgImageOpacity={1}
      title="Select all that apply"
    ></FilterSection>
  );
}

export default FilterPage;
